import React from 'react'
import { useState } from 'react'
import AdminLogin from './AdminLogin'
import UserLogin from './UserLogin'
import './login.module.css'
//-----

function Login() {

    let [isAdmin, setIsAdmin] = useState(!isAdmin)

//-----

  return (
    <div>
        <button
        onClick={()=>{
            setIsAdmin(!isAdmin)
        }}>User</button>

        <button 
        onClick={()=>{
            setIsAdmin(false)
        }}>Admin</button>

        <div>
            {isAdmin?<UserLogin/>:<AdminLogin/>}
        </div>

    </div>
  )
}

export default Login
